export default function GetGameData(data) {
    if(instance.st === 2){
        const status = data.cl
    }
    const GameData = {
        'date': data.gdte,
        'time': data.utctm,
        'city': data.ac,
        'state': data.as,
        'home': data.hls.tn,
        'away': data.vls.tn,
        'status': data.st
    };

    return GameData;
}
